(1, '10-blog-1', NULL, 'গোপালগঞ্জে বাসের ধাক্কায় মিলন মণ্ডল (১২) নামের এক স্কুলছাত্র নিহত হয়েছে। এ ঘটনায় অনীক চৌধুরী নামে আরেক স্কুলছাত্র আহত হয়েছে। আজ শনিবার সকাল আটটার দিকে ভেন্নাবাড়ির বটতলা এলাকায় গোপালগঞ্জ-টেকেরহাট সড়কে এ দুর্ঘটনা ঘটে।নিহত মিলন ও অনীক ভেন্নাবাড়ি সম্মিলিত উচ্চ বিদ্যালয়ের ষষ্ঠ শ্রেণির ছাত্র। মিলন সাতপাড় ইউনিয়নের ভেন্নাবাড়ি গ্রামের দেবেন মণ্ডলের ছেলে। আহত অনীককে ফরিদপুর মেডিকেল কলেজ হাসপাতালে ভর্তি করা হয়েছে। এ ঘটনায় বিক্ষুব্ধ এলাকাবাসী ঘটনাস্থলে গাছের গুঁড়ি ফেলে সড়ক অবরোধ করে। প্রায় পাঁচ ঘণ্টা পর ওই স্থানে গতিরোধক নির্মাণ ও দোষীদের সাজার আশ্বাস দেওয়ার পর অবরোধ তুলে নেয় এলাকাবাসী।', '', 0, '2016-07-13 08:29:47', 0),
