(5, 16, 'Lorem Ipsum is simply dummy', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book', '2016-07-13 21:01:32', '2016-07-13 21:01:32', NULL, 1, 'businesslocation.jpg', 10),
(6, 16, 'But I must explain to you how all this mistaken', 'But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful.?"', '2016-07-13 21:04:18', '2016-07-13 21:04:18', NULL, 1, 'vector-business-.jpg', 10),
(7, 50, 'PATROS – Free HTML5/CSS3 Responsive Website Template.', 'নতুন কমিটি নিয়ে বিএনপিতে ক্ষোভ-হতাশা বাড়ছে। মাঠের রাজনীতিতে বেকায়দায় থাকায় দলটিতে তাৎক্ষণিকভাবে এই ক্ষোভের বড় কোনো&nbsp;বহিঃপ্রকাশ না ঘটলেও কোনো কোনো নেতা রাজনীতিতে নিষ্ক্রিয় থাকার চিন্তা করছেন।&nbsp;নতুন কমিটিতে পদ পাওয়া নেতাদের অনেকের সঙ্গে কথা বলে দলটির অভ্যন্তরীণ এই চিত্র পাওয়া গেছে। নেতাদের অনেকের অভিযোগ, নতুন কমিটি গঠনের ক্ষেত্রে বিএনপির চেয়ারপারসনের বিশেষ সহকারী শিমুল বিশ্বাস, সিনিয়র যুগ্ম মহাসচিব রুহুল কবির রিজভী ও স্থায়ী কমিটির সদস্য গয়েশ্বর চন্দ্র রায়ের প্রভাব কাজ করেছে।', '2016-08-04 23:54:24', '2016-08-08 09:22:22', NULL, 1, 'unsplash1.jpg', 50),
(8, 50, 'SMART BUSINESS SOLUTIONS!', 'কেবল জ্যেষ্ঠ নয়, মাঝারি পর্যায়ের নেতাদের মধ্যেও কমিটি নিয়ে ক্ষোভ আছে। তাঁদের একজন আগের কমিটির সহদপ্তর সম্পাদক শামীমুর রহমান। নতুন কমিটিতে তাঁকে সহপ্রচার সম্পাদক পদ দেওয়া হয়। তিনি কমিটি ঘোষণার পরপর নিজের নাম প্রত্যাহার করার আবেদন করেন।', '2016-08-04 23:57:18', '2016-08-08 09:22:42', NULL, 1, 'unsplash2.jpg', 50),
(9, 50, 'Lorem Ipsum is simply dummy text of typesetting industry.', 'সম্পাদকীয় পদ পাওয়া আরেক নারীনেত্রী নাম প্রকাশ না করার শর্তে বলেন, ‘যাদের দিয়ে কমিটি করেছে, তারা বিএনপিকে ক্ষমতায় নিতে পারলে ভালো। আমরা না হয় কিছুদিন বিশ্রাম নিলাম।’দলীয় দায়িত্বশীল একাধিক সূত্র জানায়, কমিটি করা নিয়ে দলের নীতিনির্ধারণী পরিষদ স্থায়ী কমিটির নেতাদের একটি বড় অংশ ছিল একেবারে অন্ধকারে। তাঁদের সঙ্গে এ বিষয়ে আলোচনা হয়নি। নেতা-কর্মীদের মধ্যে একটা ধারণা তৈরি হয়েছে যে কমিটি গঠনে রিজভী ও শিমুল বিশ্বাসের ভূমিকা ছিল। নেপথ্যে তাঁদের সঙ্গে গয়েশ্বর চন্দ্র রায়ও ছিলেন। এ কারণে তাঁদের অনুসারী হিসেবে পরিচিতরা ভালো পদ-পদবি পেয়েছেন। দলের কেন্দ্রীয় দপ্তর পুরোপুরি রিজভীর হাতে চলে গেছে।', '2016-08-04 23:58:04', '2016-08-08 09:23:09', NULL, 1, 'unsplash5.jpg', 50);
