(2, 'Blog', 'Blog', 'blog', 1, 'When expressing an interest in obtaining additional information about the Services or registering to use the Services, Salesforce.org requires you to provide Salesforce.org with personal contact information, such as name, company name, address, phone number, and email address (“Required Contact Information”). When purchasing the Services, Salesforce.org may require you to provide Salesforce.org with financial qualification and billing information, such as billing name and address, credit card number, and the number of employees within the organization that will be using the Services (“Billing Information”). Salesforce.org may also ask you to provide additional information, such as company annual revenues, number of employees, or industry (“Optional Information”). Required Contact Information, Billing Information, and Optional Information about Visitors or Customers are referred to collectively as “Data About Salesforce.org Customers”, or in the case of Attendees, “Data About Salesforce.org Attendees”.\n', 'Blog', 1, 0, 'blog', 200),
