INSERT INTO `News` (`id`, `user_id`, `name`, `slug`, `content`, `feature`, `status`, `path`, `globalOption_id`, `authorName`, `designation`, `created`, `updated_at`, `photoGallery_id`) VALUES
(1, 34, 'The admissions process in Scholastica is very transparent. Anyone is welcome to apply without any reference', 'xebec-international-school-', 'The admissions process in Scholastica is very transparent. Anyone is welcome to apply without any reference. Absolutely no donations are accepted; only published fees are required.During the admissions process, interviews are held by a panel of senior management, not a single individual. The interview panel is a team of qualified individuals from Scholastica''s senior management. All decisions for admission are made through a committee, not by any one individual.<span>No external agents/agencies are appointed or involved in the admissions process; the Admissions Office is the only point of contact for all admissions-related applications and inquiries. No Ascent Group personnel have a role in the admissions process except those in the Admissions Office and on the interview and selection panel.<br></span>The admissions process in Scholastica is very transparent. Anyone is welcome to apply without any reference. Absolutely no donations are accepted; only published fees are required.During the admissions process, interviews are held by a panel of senior management, not a single individual. The interview panel is a team of qualified individuals from Scholastica''s senior management. All decisions for admission are made through a committee, not by any one individual.No external agents/agencies are appointed or involved in the admissions process; the Admissions Office is the only point of contact for all admissions-related applications and inquiries. No Ascent Group personnel have a role in the admissions process except those in the Admissions Office and on the interview and selection panel.', 1, 1, '3134.full.jpg', 38, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(3, 34, 'Application Forms are available in our campuses in Dhanmondi', 'xebec-international-school-', 'Application Forms are available in our campuses in Dhanmondi, Gulshan, Mirpur and Uttara at the respective Fee Collection Booth.Playgroup Admissions:&nbsp;&nbsp;Application Forms are available from&nbsp;September&nbsp;for the next academic session which starts in July. Interview sessions are done immediately; therefore parents are advised to apply when the child is 2.5 years old and as early as possible since admission is offered on a first-come-first-served basis.Nursery to IX Admissions:&nbsp;&nbsp;Application Forms are given out from January for the next July. The Admission Testing starts in spring.A-Level Admissions:&nbsp;&nbsp; Application Forms are given out in June for the coming academic session. Admission is only offered if students meet minimum academic requirements.Successful candidates who cannot be admitted due to unavailability of seats are kept in the waiting list and are notified as and when vacancies arise.', 0, 1, 'banner1.jpg', 38, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(4, 16, 'এরদোয়ানের ‘শত্রু’ ফেতুল্লা গুলেন কে', 'nahar-fashion-', 'তুরস্কে গতকাল শুক্রবার রাতের সেনা অভ্যুত্থানের পেছনে যুক্তরাষ্ট্রে বসবাসকারী ধর্মীয় নেতা ফেতুল্লা গুলেনকে দায়ী করেছেন তুর্কি প্রেসিডেন্ট রিসেপ তাইয়েপ এরদোয়ান ও প্রধানমন্ত্রী বিনালি ইলদিরিম। যদিও গুলেন ও তাঁর সমর্থক যুক্তরাষ্ট্রভিত্তিক সংগঠন এ অভিযোগ অস্বীকার করেছে। তিনি অভ্যুত্থান প্রচেষ্টার নিন্দাও করেছেন।<br>স্বীকার-অস্বীকার যা-ই করুন, অভ্যুত্থানের ঘটনার পর ফেতুল্লা গুলেন আবার আলোচনার কেন্দ্রবিন্দুতে। বিশ্বজুড়ে তাঁকে ঘিরে সৃষ্টি হয়েছে ঔৎসুক্য। এরদোয়ানের একসময়ের ঘনিষ্ঠ সহযোগী ফেতুল্লা গুলেন একজন ইসলাম প্রচারক। তিনি এখন থাকেন যুক্তরাষ্ট্রের পেনসিলভানিয়া অঙ্গরাজ্যের পোকোনো পার্বত্য এলাকার একটি ছোট শহরে। ১৯৯৯ সাল থেকে তিনি সেখানে আছেন। নিজ দেশ তুরস্কে রাষ্ট্রদ্রোহের অভিযোগ ওঠার পর থেকেই তাঁর যুক্তরাষ্ট্রে বসবাস। এরপর থেকে গুলেন একধরনের অজ্ঞাতবাসের মধ্যেই আছেন বলা যায়। ৭৫ বছর বয়সী এ ধর্মপ্রচারক কাউকে সাক্ষাৎকার দেন না, জনসমক্ষে তাঁকে দেখা যায় কদাচিৎ।', 0, 1, '85082e57d33dd62d5821f9f6ea12c9b8-Gulen.jpg', 10, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(5, 16, 'গুলশান হামলার মদদদাতারা চিহ্নিত : স্বরাষ্ট্রমন্ত্রী', 'nahar-fashion-', 'গুলশানের হলি আর্টিজান বেকারি রেস্তোরাঁয় হামলার মদদদাতাদের চিহ্নিত করা হয়েছে বলে জানিয়েছেন স্বরাষ্ট্রমন্ত্রী আসাদুজ্জামান খান কামাল। আজ শনিবার দুপুরে সচিবালয়ে নিজের কার্যালয়ে সাংবাদিকদের প্রশ্নের জবাবে স্বরাষ্ট্রমন্ত্রী এ কথা বলেন।<br>স্বরাষ্ট্রমন্ত্রী বলেন, ১ জুলাইয়ের হামলায় (গুলশান হামলা) যাঁরা যাঁরা জড়িত যাঁরা যাঁরা মদদ দিয়েছেন, তাঁদের পুলিশ চিহ্নিত করতে পেরেছে। তিনি বলেন, ‘যাঁরা যাঁরা এ​র মদদ দিচ্ছেন, তাঁদের আমরা চিহ্নিত করেছি। আমাদের নিরাপত্তা বাহিনী, আমাদের গোয়েন্দা বাহিনী অত্যন্ত তৎ​পর। আমরা মনে ক​রছি আমরা সঠিক পথে চলছি। আমরা যারা জড়িত, তাদের ঠিকমতো চিহ্নিত করেছি।’<br>স্বরাষ্ট্রমন্ত্রী বলেন, আগুনসন্ত্রাস করে যারা সরকারকে পর্যুদস্ত করতে চেয়েছিল, তারা ব্যর্থ হয়ে গুপ্তহত্যায় লিপ্ত হয়েছিল। তারাই টার্গেট কিলিং করছে। তবে সে প্রচেষ্টাও ব্যর্থ হয়েছে। সরকার এগুলো মোকাবিলা করে ওভারকাম করে চলছে। গুলশান হামলার আগে যে সাঁড়াশি অভিযান চালিয়েছিল, এখন আবার তা চলবে কি না, জানতে চাইলে মন্ত্রী বলেন, এ ধরনের অভিযান সব সময়ই চলে। কখনো ঘোষণা দিয়ে চলে, কখনো ঘোষণা ছাড়াই চলে। প্রয়োজন হলে আইনশৃঙ্খলা রক্ষাকারী বাহিনী যেকোনো সময় অভিযান চালাতে পারে।', 0, 1, 'prin.jpg', 10, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(6, 50, 'অ্যাশ, ক্যাট, লোলো, বেবো, প্রীতি, রানি, প্রিয়াঙ্কা', 'orchecd-palaza-ayaash-kyaatt-lolo-bebo-priiti-raani-priyyaangkaa', 'অ্যাশ, ক্যাট, লোলো, বেবো, প্রীতি, রানি, প্রিয়াঙ্কা—কে অভিনয় করেননি তাঁর সঙ্গে? সবার সঙ্গে জুটি বেঁধে রুপালি পর্দায় অভিনয় করেছেন। তবে এঁদের কাউকেই ১ নম্বরে রাখলেন না হৃতিক। তাঁর পছন্দের সহশিল্পী হিসেবে এক নবাগতের নাম বললেন কৃশ তারকা!<br>একটি অনুষ্ঠানে ভক্তদের সঙ্গে মতবিনিময়কালে হৃতিক বলেন, ‘আমি মনে করি, পূজা হেগড়ে এ পর্যন্ত আমার সেরা সহশিল্পী।’&nbsp;<br>হৃতিক এর আগে বলিউডের এক ঝাঁক জনপ্রিয় নায়িকার সঙ্গে অভিনয় করেছেন। তাঁদের মধ্যে আছেন কারিশমা কাপুর (লোলো), ঐশ্বরিয়া রায় (অ্যাশ), রানি মুখার্জি, প্রীতি জিনতা, কারিনা কাপুর (বেবো), প্রিয়াঙ্কা চোপড়া, ক্যাটরিনা কাইফ (ক্যাট) ও কঙ্গনা রনৌত।<br>হিন্দি ছবিতে মাত্রই আসা পূজা বলেন, ‘আমি খুবই গর্বিত এবং কৃতজ্ঞ যে এ রকম একটি চলচ্চিত্রে একজন গুণী অভিনেতার সঙ্গে অভিনয় করার সুযোগ পেয়েছি। আমি মনে করি, “মহেঞ্জোদারো” হবে তাঁর সেরা অভিনয়ের একটি ছবি। আমি সম্মানিত বোধ করছি আশুতোষ গোয়ারিকরের সঙ্গে কাজ করেও। তিনি আমার স্বপ্নের পরিচালকদের একজন।’ হিন্দুস্তান টাইমস।', 0, 1, '20160812170841_port5.jpg', 50, 'চলচ্চিত্রে', NULL, '2016-08-12 17:41:34', '2016-08-12 17:41:34', NULL),
