(8, 50, 'শিশুদের কষ্ট দেবেন না', 'orchecd-palaza-shishuder-ksstt-deben-naa', 'গুলশানের হলি আর্টিজান রেস্তোরাঁয় জঙ্গি হামলার পর ঢাকার নিরাপত্তা নিশ্চিত করার ব্যাপারে বেশ তোড়জোড় শুরু হয়েছে। ইতিমধ্যে গুলশান ও ধানমন্ডির মতো আবাসিক এলাকা থেকে অবৈধ স্থাপনা উচ্ছেদ শুরু হয়েছে। ধানমন্ডি এলাকার ৫১টি স্কুলকেও সরে যেতে হবে। এখন শুধু সময়ের অপেক্ষা। কিন্তু কথা হচ্ছে, নগর পরিকল্পনায় একসময় আবাসিক, শিল্প ও বাণিজ্যিক এলাকা আলাদা থাকলেও এখন মিশ্র ব্যবস্থা করা হয়, যাতে লোককে রাস্তায় কম বেরোতে হয় বা দৈনন্দিন কাজের জন্য এক এলাকা থেকে আরেক এলাকায় যেতে না হয়। যানজটকবলিত ঢাকার জন্য এটি অপরিহার্য হয়ে উঠেছে।&nbsp;<br>ধানমন্ডি যখন আবাসিক এলাকা হিসেবে গড়ে ওঠে, তখন ধারণা করা হয়েছিল, প্রতি একর জমিতে গড়ে ৫০ জন মানুষ বসবাস করবে। এখন বাস করে অনেক গুণ। ফলে আইনেরও পরিবর্তন করা দরকার। কথা হচ্ছে, আবাসিক প্লটে বা এলাকায় বাণিজ্যিক স্থাপনা করা হলে আবাসিক এলাকার বৈশিষ্ট্য নষ্ট হয় তা ঠিক, কিন্তু যখন এগুলো করা হয়েছিল, তখন সরকারের সংশ্লিষ্ট দপ্তর কেন বাধা দেয়নি? হঠাৎ করে উচ্ছেদ অভিযান চালালে হবে না। বিশেষ করে স্কুলগুলোর শিক্ষার্থীদের কথা বিবেচনা করা দরকার। বহু বছর ধরেই ধানমন্ডির এই ইংরেজি মাধ্যম স্কুলগুলো গড়ে উঠেছে। সেখানে বহু ছাত্রছাত্রী যেমন পড়াশোনা করছে, তেমনি সেখানে অনেকের কর্মসংস্থানও হয়েছে। ফলে হুট করে সেগুলো উঠিয়ে দিলে ছাত্রছাত্রীদের পড়াশোনা ব্যাহত হবে। উদ্যোক্তাদের পাশাপাশি শিক্ষক-কর্মকর্তা-কর্মচারীরাও অনিশ্চয়তায় পড়বেন।&nbsp;<br>এখন যদি ধানমন্ডির স্কুলগুলো ঢাকার বিভিন্ন অঞ্চলে ছড়িয়ে ছিটিয়ে পড়ে, তাহলে কী বিপদ হবে, তা নিশ্চয়ই ব্যাখ্যা করার প্রয়োজন নেই। যদি ম্যাপল লিফ স্কুলের নতুন ক্যাম্পাস হয় মিরপুর ১ নম্বরে, তাহলে স্কুলটির বর্তমান ছাত্রছাত্রীদের সেখানে গিয়ে স্কুল করতে হবে। এই স্কুলের বেশির ভাগ ছাত্রছাত্রী ধানমন্ডি ও আশপাশের এলাকার। কারণ, অভিভাবকেরা সাধারণত সন্তানদের স্কুলের আশপাশে বাসা নিতে চান, যাতে সন্তানের স্কুলে আসা-যাওয়ায় সমস্যা না হয়। একই কথা প্রযোজ্য অন্যান্য বিদ্যালয়ের বেলায়ও।&nbsp;', 0, 1, '20160812170852_blog3.jpg', 50, 'প্রতীক বর্ধন', 'STAFF REPORTER', '2016-08-12 17:52:21', '2016-08-12 17:52:21', 11),
(9, 50, 'রাজনৈতিক পক্ষপাতের ঊর্ধ্বে থাকতে হবে', 'orchecd-palaza-raajnaitik-pksspaater-uurdhbe-thaakte-hbe', 'ট্রান্সপারেন্সি ইন্টারন্যাশনাল বাংলাদেশ বা টিআইবির সাম্প্রতিক গবেষণায় দুর্নীতি দমন কমিশনকে (দুদক) আইনি কাঠামোয় শক্তিশালী প্রতিষ্ঠান হিসেবে চিহ্নিত করা হয়েছে। কিন্তু একই গবেষণায় যখন সংস্থাটি রাজনৈতিক পক্ষপাতের ঊর্ধ্বে নয় এবং এর প্রতি জনগণের আস্থা কম বলে উপসংহার টানা হয়, তখন কাঠামোগত শক্তি অনেকটাই মূল্যহীন হয়ে পড়ে।<br>টিআইবির গবেষণায় ২০১৩ থেকে ২০১৫ সাল পর্যন্ত দুদকের কার্যক্রম অন্তর্ভুক্ত ছিল। আইনি স্বাধীনতা ও অবস্থান, অর্থ ও মানবসম্পদ, অনুসন্ধান ও তদন্ত কার্যক্রম, প্রতিরোধ, অন্যান্য প্রতিষ্ঠানের সঙ্গে সহযোগিতা, জবাবদিহি ও তদারকি এবং দুদকের কার্যক্রম সম্পর্কে জনগণের ধারণা—এই সাতটি ক্ষেত্রের অধীনে ৫০টি নির্দেশকের ভিত্তিতে গবেষণায় দুদকের গড় নম্বর ৬১ দশমিক ২২ শতাংশ হলেও জনগণের ধারণার ক্ষেত্রে সবচেয়ে কম নম্বর ২৮ দশমিক ৫৭ পেয়েছে। শুরু থেকে দুদক একটি নিষ্ক্রিয় ও পক্ষপাতপুষ্ট প্রতিষ্ঠান হিসেবে বিবেচিত। ব্যাংকিং খাতে হাজার হাজার কোটি টাকা লোপাটের ঘটনায় দুদক চুনোপুঁটিদের নিয়ে টানাটানি করলেও রাঘববোয়ালেরা ধরাছোঁয়ার ঊর্ধ্বেই থেকে যাচ্ছে। দ্বিতীয়ত, অতীতের দুর্নীতি নিয়ে প্রতিষ্ঠানটি যতটা সক্রিয় বর্তমানের দুর্নীতি নিয়ে ততটাই নিষ্ক্রিয়।<br>দুদকের দুর্বলতা কাটিয়ে উঠতে টিআইবি কিছু সুপারিশও করেছে, যার মধ্যে রয়েছে বাজেট বৃদ্ধি, সাংগঠনিক কাঠামো ও জনবল বৃদ্ধি, চেয়ারম্যান ও কমিশনারদের নিয়োগ– প্রক্রিয়ায় স্বচ্ছতা বাড়ানো, অভিযোগ দাখিল ব্যবস্থায় আধুনিকায়ন ও তথ্যপ্রযুক্তির ব্যবহার বাড়ানোসহ স্বাধীন তদারকি ব্যবস্থা। এসব সুপারিশ বাস্তবায়িত হলে দুর্নীতি নির্মূল না হলেও নিয়ন্ত্রণে আনা কঠিন হবে না।<br>দুদকের চেয়ারম্যান টিআইবির প্রতিবেদনের সত্যতা স্বীকার করে বলেছেন, ‘আস্থার সংকট কাটাতে আমরা কাজ করছি।’ অতীতে যাঁরা দুদকের দায়িত্বে ছিলেন, তঁারা ব্যর্থতা বা ঘাটতি স্বীকারই করতে চাননি। দুদক তখনই জনগণের আস্থা লাভ করবে, যখন রাজনৈতিক বিবেচনার ঊর্ধ্বে উঠে প্রতিষ্ঠানটি সব দুর্নীতিবাজকে আইনের আওতায় এনে শাস্তি নিশ্চিত করতে পারবে।', 0, 1, '20160812180816_unsplash5.jpg', 50, NULL, NULL, '2016-08-12 18:16:23', '2016-08-12 18:16:23', NULL);
