INSERT INTO `NoticeBoard` (`id`, `user_id`, `name`, `slug`, `content`, `created`, `updated_at`, `startDate`, `endDate`, `status`, `path`, `globalOption_id`) VALUES
(1, 16, 'নর্থ সাউথ বিশ্ববিদ্যালয়ের অধ্যাপকসহ তিনজন আটক', 'নর-থ-স-উথ-ব-শ-বব-দ-য-লয়-র-অধ-য-পকসহ-ত-নজন-আটক', 'গুলশানে জঙ্গি হামলায় জড়িত জঙ্গিদের বাড়ি ভাড়া দেওয়ার আগে নাম ঠিকানাসহ তথ্য না রাখায় নর্থ সাউথ বিশ্ববিদ্যালয়ের অধ্যাপকসহ তিনজনকে আটক করেছে ঢাকা মেট্রোপলিটন পুলি​শের (​ডিএমপি) কাউন্টার টেররিজম ইউনিট। আজ বিকেল পাঁচটার দিকে শহরের বিভিন্ন জায়গায় অভিযান চালিয়ে তাঁদের আটক করা হয়।&nbsp;<br>আটক ব্যক্তিরা হলেন, নর্থ সাউথ বিশ্ববিদ্যালয়ের স্কুল অব হেলথ্ অ্যান্ড লাইফ সাইন্সেসের ডিন গিয়াস উদ্দিন আহসান, তাঁর ভাগনে আলম চৌধুরী এবং ভবনের ব্যবস্থাপক মাহবুবুর রহমান ওরফে তুহিন।<br>ঢাকা মহানগর পুলিশের গণমাধ্যম শাখার উপকমিশনার (ডিসি) মাসুদুর রহমান এ তথ্যের সত্যতা নিশ্চিত করেছেন।&nbsp;<br>ডিসি বলেন, জঙ্গিরা বসুন্ধরা আবাসিক এলাকার ছয় নম্বর সড়ক ব্লক ই এর টেনামেন্ট-তিন-এর ফ্ল্যাট এ/৬ এ একত্রিত হয়েছিল। গত &nbsp;মে মাসে এ ফ্ল্যাটটি জঙ্গিদের অন্য সহযোগী সদস্যরা ভাড়া নিয়েছিল। গুলশানের সন্ত্রাসী হামলার পর তাঁরা দ্রুত বাসা ছেড়ে পালিয়ে যান। বাসা থেকে বালুভর্তি কার্টন ও তাঁদের পরিধেয় বস্ত্রসহ বিভিন্ন মালামাল জব্দ করা হয়েছে। বালুভর্তি এসব কার্টনে হামলায় ব্যবহৃত গ্রেনেড রাখা হয়েছিল বলে ধারণা করছে পুলিশ।&nbsp;', '2016-07-16 23:57:24', '2016-07-16 23:57:24', '2025-01-01 00:00:00', '2011-01-01 00:00:00', 1, 'MOTIJHEEL2 CUSTOMERS - Mismatch security deposit.xls', 10),
(2, 16, 'তুরস্কে ‘ব্যর্থ’ সেনা অভ্যুত্থান, নিহত ২৬৫', 'ত-রস-ক-ব-যর-থ-স-ন-অভ-য-ত-থ-ন-ন-হত-২৬৫', '<div><div><div><div><div>তুরস্কের প্রেসিডেন্ট রিসেপ তাইয়েপ এরদোয়ান সরকারের বিরুদ্ধে সেনাবাহিনীর একাংশ ট্যাংক ও যুদ্ধবিমান নিয়ে অভ্যুত্থানের ‘ব্যর্থ’ চেষ্টা চালিয়েছে। দেশটির সরকারি সংবাদ সংস্থা আনাদোলুর বরাত দিয়ে এএফপি বলছে, এ পর্যন্ত ২৬৫ জন নিহত হয়েছে; এর মধ্যে অভ্যুত্থানকারী ১০৪ জন। বাকিরা পুলিশ ও বেসামরিক লোকজন।<div></div>তুরস্কের আঙ্কারা ও ইস্তাম্বুলে গতকাল শুক্রবার রাতে সেনাবাহিনীর একাংশ অভ্যুত্থান চালাতে রাস্তায় নেমে আসে। বিভিন্ন এলাকায় তারা অবস্থান নেয়। এ সময় পুলিশের সঙ্গে তাদের সংঘর্ষ হয়। শোনা যায় বিস্ফোরণ ও গুলির শব্দ। এ সময় প্রেসিডেন্ট এরদোয়ানের আহ্বানে সাড়া দিয়ে ক্ষমতাসীন জাস্টিস অ্যান্ড ডেভেলপমেন্ট পার্টির (একেপি) সমর্থকেরা রাস্তায় নেমে আসে। পুলিশের পাশাপাশি তাদের সঙ্গেও অভ্যুত্থানকারীদের রাতভর সংঘর্ষ চলে। আজ শনিবার সকালেও দেশটির বড় বড় শহরে বিস্ফোরণ, গুলি ও সংঘর্ষ চলে।কয়েক ঘণ্টা ধরে নৈরাজ্যকর অবস্থা চলার পর আজ সকালে ইস্তাম্বুলে আতাতুর্ক বিমানবন্দরে পৌঁছান প্রেসিডেন্ট এরদোয়ান। সেখানে দেওয়া ভাষণে তিনি পরিস্থিতি সরকারের নিয়ন্ত্রণে রয়েছে বলে দাবি করেন। তিনি বলেন, এ ধরনের অভ্যুত্থান জনগণের সঙ্গে প্রতারণা। অভ্যুত্থানকারীদের এ জন্য চড়া মূল্য দিতে হবে। তুরস্ককে কোনো দখলদারের কাছে দেওয়া হবে না। একেপির শত শত সমর্থককে শুভেচ্ছা জানান তিনি। এ ছাড়া তিনি অভ্যুত্থানের পরিকল্পনাকারীদের ব্যবহৃত বিমান গুলি করে ভূপাতিত করার নির্দেশ দেন।প্রেসিডেন্ট এরদোয়ান তখন বলেন, দেশটির সেনাপ্রধান জেনারেল হুলুসি আকার কোথায়, কী অবস্থায় আছেন, তিনি জানেন না। পরে প্রধানমন্ত্রী বিনালি ইয়েলদ্রিম জানান, ভারপ্রাপ্ত নতুন সেনাপ্রধান হিসেবে উমিত দুনদারকে দায়িত্ব দেওয়া হয়েছে। পরে অবশ্য রাজধানী আঙ্কারা থেকে উত্তর-পশ্চিমে আতিনজি বিমানঘাঁটিতে অভিযান চালিয়ে হুলুসি আকারকে উদ্ধার করা হয়। শুক্রবার রাতেই অভ্যুত্থানকারীরা তাঁকে জিম্মি করেছিল বলে প্রাথমিকভাবে জানা গেছে।প্রেসিডেন্ট এরদোয়ান অভ্যুত্থানের পেছনে দেশটির ধর্মীয় নেতা ফেতুল্লাহ গুলেনের জড়িত থাকার অভিযোগ আনেন। তবে গুলেন এ অভিযোগ অস্বীকার করে অভ্যুত্থানের সঙ্গে তাঁকে জড়ানোয় তীব্র নিন্দা জানান। তিনি বলেন, তিনি তুরস্কের জনগণের জন্য সৃষ্টিকর্তার কাছে প্রার্থনা করছেন। তুরস্ক যাতে শান্তিপূর্ণভাবে ও দ্রুত এই কঠিন সময় পার হতে পারে, এ জন্য প্রার্থনা করছেন। ৭৫ বছর বয়সী গুলেন একসময় এরদোয়ানের ঘনিষ্ঠ বন্ধু ছিলেন। তবে গত কয়েক বছরে দুজনের বন্ধুত্বে চিড় ধরে। এরদোয়ান গুলেনের হিজমত আন্দোলন নিয়ে সন্দেহ প্রকাশ করেন। একই সঙ্গে তিনি তুর্কি সমাজ, গণমাধ্যম, পুলিশ ও বিচারব্যবস্থায় গুলেনের শক্তিশালী উপস্থিতি নিয়ে প্রশ্ন তোলেন। দেশের সঙ্গে বিশ্বাসঘাতকতা করার অভিযোগ ওঠার পর ১৯৯৯ সালে গুলেন যুক্তরাষ্ট্রে স্বেচ্ছা নির্বাসনে চলে যান। বর্তমানে তিনি যুক্তরাষ্ট্রের পেনসিলভানিয়ার ফোকোনো পাহাড়ি এলাকার ছোট একটি শহরে বাস করেন।সময় বাড়ার সঙ্গে সঙ্গে পরিস্থিতি বদলাতে থাকে। তুরস্কের ইউরোপ ও এশিয়াকে যুক্ত করা বসফরাস সেতুর ওপর অবস্থান নেওয়া অভ্যুত্থানকারী সেনারা আত্মসমর্পণ করতে শুরু করে। এ সময় শত শত সেনার আত্মসমর্পণের দৃশ্য টেলিভিশনের ফুটেজে দেখা গেছে। ​দুপুরের দিকে আঙ্কারায় নিজের কার্যালয়ে দেশটির প্রধানমন্ত্রী বিনালি ইয়েলদ্রিম বলেন, অভ্যুত্থানের সঙ্গে জড়িত সন্দেহে প্রায় তিন হাজার সেনাসদস্যকে আটক করা হয়েছে। অভ্যুত্থানকারীদের সঙ্গে সংঘর্ষে পুলিশ-জনতার ১৬১ জন মারা গেছে। আহত হয়েছে ১ হাজার ৪৪০ জন।আর দেশটির ভারপ্রাপ্ত সেনাপ্রধান উমিত দুনদার টেলিভিশনের মাধ্যমে বলেন, ‘অভ্যুত্থানকারী ১০৪ সেনাসদস্য নিহত হয়েছে। সেনা অভ্যুত্থানের চেষ্টা ব্যর্থ হয়ে গেছে।’তবে এখনই তৃপ্তির ঢেকুর তুলতে নারাজ প্রেসিডেন্ট এরদোয়ান। নিজ দলের সমর্থকদের রাস্তায় থাকার আহ্বান জানিয়েছেন তিনি। সামাজিক যোগাযোগের মাধ্যম টুইটারে দেওয়া এক বার্তায় এরদোয়ান বলেন, ‘সেনা অভ্যুত্থানের চেষ্টা যে অবস্থাতেই থাকুক না কেন, আমাদের সারা রাত রাস্তায় থাকতে হবে। কারণ, যেকোনো মুহূর্তে আবার নতুন করে এ ধরনের ঘটনা ঘটতে পারে।’এই অভ্যুত্থানের দায় কোনো ঊর্ধ্বতন সেনা কর্মকর্তা দাবি করেননি। তবে অভ্যুত্থানকারীদের ভাষ্য, সংবিধান রক্ষা এবং গণতন্ত্র, মানবাধিকার ও মতপ্রকাশের স্বাধীনতা রক্ষার জন্য তাদের এই অভ্যুত্থান।<span>১৯২৩ সালে মুস্তফা কামাল আতাতুর্কের হাত ধরে ধর্মনিরপেক্ষ তুরস্কের যাত্রা শুরু। ১৯৬০ সাল থেকে এখন পর্যন্ত তিনটি অভ্যুত্থানের ঘটনা ঘটেছে দেশটিতে।<br>আরও পড়ুন:&nbsp;<a href="http://www.prothom-alo.com/international/article/915976/%E0%A6%B8%E0%A6%AC%E0%A6%BE%E0%A6%87%E0%A6%95%E0%A7%87-%E0%A6%B0%E0%A6%BE%E0%A6%B8%E0%A7%