(40, 31, 50, 'Responsive Design', 'Responsive', 'orchecd-palaza-about-us-responsive', 'গুলশানের হলি আর্টিজানের হত্যাযজ্ঞ চোখের সামনে দেখেছেন ভারতীয় চিকিৎসক সত প্রকাশ। উপস্থিত বুদ্ধি কাজে লাগিয়েছেন। শেষ পর্যন্ত বেঁচে ফিরতে পেরেছেন।<div></div>গত ২৬ জুলাই চোখে দেখা ও শোনা ঘটনার বিবরণ দিয়ে আদালতে জবানবন্দি দিয়েছেন সত প্রকাশ। ইংরেজিতে হাতে লেখা আট পাতার ওই জবানবন্দির পরতে পরতে হিংস্রতা, নিষ্ঠুরতা, আতঙ্ক আর বাঁচার চেষ্টার বিবরণ।ঘটনার শুরু থেকে বর্ণনা দিয়ে&nbsp;সত প্রকাশ বলেন, ‘সেদিন ছিল শুক্রবার। হলি আর্টিজান বেকারিতে যাব বলে ঠিক করলাম। আমি গাড়িতে করে পৌঁছলাম ওখানে। গাড়ি পার্ক করে সাড়ে আটটার দিকে ভেতরে ঢুকলাম। আমি বাইরের দিকে বসলাম। যে কোনায় আমার টেবিলটা, সেটার মুখ সামনের দিকে। এর মধ্যেই আমি তন্ময় নামে আমার এক বন্ধুকে ফোন করলাম। ও বলল খাবে না, তবে দেখা করতে আসবে। আমি পাস্তা আর কমলার জুস চাইলাম। ওরা (রেস্তোরাঁ) আমাকে এর সঙ্গে রুটি আর সসেজ দিয়েছিল শুভেচ্ছা স্বরূপ। আমি আমার বন্ধুর জন্য অপেক্ষা করছি। হঠাৎ আমি দেখলাম দুই থেকে তিনজন লোক রেস্তোরাঁর মূল ফটকে ধাক্কা দিচ্ছে। তারপর জোরে ঠেলছে। তারপর আমি শব্দ শুনতে পেলাম, যেটা পটকার আওয়াজের মতো মনে হলো।’', 1, '2016-08-07 08:37:03', '2016-08-13 01:28:50', NULL, NULL, 50, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
