(47, NULL, 50, 'বিমার অর্থ পেতে নিজের হাত-পা কাটালেন', NULL, 'bimaar-arth-pete-nijer-haat-paa-kaattaalen', 'বড় অঙ্কের বিমার অর্থ পেতে বন্ধুকে দিয়ে নিজের একটি হাত ও পা কাটিয়েছেন ভিয়েতনামের এক নারী! আর এ জন্য তিনি ওই বন্ধুকে অর্থও দিয়েছেন!<div></div><span>ভিয়েতনামের রাষ্ট্রীয় সংবাদমাধ্যম এ খবর প্রকাশ করেছে। খবরে ওই নারীর নাম উল্লেখ না করে বলা হয়, গত মে মাসে রাজধানী হ্যানয়ের একটি হাসপাতালে বাঁ পা ও বাঁ হাতের এক-তৃতীয়াংশ কাটা অবস্থায় ওই নারী হাসপাতালে ভর্তি হন। চিকিৎসকেরা তাঁকে জানান, কাটা হাত-পা তাঁদের পক্ষে জোড়া লাগানো সম্ভব নয়।&nbsp;<br>পরে ৩০ বছর বয়সী ওই নারী পুলিশকে জানান, তিনি রেললাইনের ওপর দিয়ে হাঁটার সময় ট্রেনে কাটা পড়েন। তাঁর বন্ধু ডোয়ান ভ্যান ডি তাঁকে উদ্ধার করেন।&nbsp;<br>দুর্ঘটনায় অঙ্গ হারানোর কথা উল্লেখ করে ওই নারী পরে বিমা কোম্পানির কাছে ১ লাখ ৩০ হাজার মার্কিন ডলার দাবি করেন। ভিয়েতনামে এটা বিপুল অঙ্কের অর্থ। কারণ, সেখানে একজনের মাসিক আয় গড়ে ২ হাজার ১০০ মার্কিন ডলার। ওই নারী বিমার অর্থ দাবি করা পর সংশ্লিষ্ট বিমা কর্তৃপক্ষের সন্দেহ হয়।</span>হ্যানয় পুলিশ এ ঘটনার বিষয়ে এএফপির কাছে কোনো মন্তব্য করতে অস্বীকৃতি জানিয়েছে। তবে স্থানীয় পত্রিকার সংবাদ থেকে জানা যায়, ওই নারী এ ধরনের ভয়াবহ হীন কাজের জন্য তাঁর বন্ধুকে দুই হাজার মার্কিন ডলার দেওয়ার প্রস্তাব দেন। আর পুলিশ সম্পদ চুরির ষড়যন্ত্রে ওই নারীকে কীভাবে অভিযুক্ত করা যায় তা খতিয়ে দেখছে।একজন পুলিশ কর্মকর্তা বলেছেন, এ ঘটনা অন্যদের জন্য একটি সতর্ক বার্তা। প্রতারণার মাধ্যমে বিমার টাকা পেতে নিজের শরীরের এমন ক্ষতি কারোরই করা উচিত নয়। তিনি বলেন, ভিয়েতনামে তিনি আগে কখনো এ ধরনের ঘটনার কথা শোনেননি।', 1, '2016-08-26 00:34:42', '2016-08-26 00:34:42', '20160826000834_10154018_1606235999645967_7031745884642726221_n.jpg', NULL, 50, 0, 1, NULL, 'এএফপি', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(48, NULL, 50, 'উৎখাত চক্রান্তের মুখে মালদ্বীপের প্রেসিডেন্ট', NULL, 'orchecd-palaza-u-khaat-ckraanter-mukhe-maaldbiiper-presiddentt', 'মালদ্বীপের প্রেসিডেন্ট আবদুল্লা ইয়ামিনকে উৎখাতের ষড়যন্ত্র চলছে। আগামী কয়েক সপ্তাহের মধ্যেই তাঁকে উৎখাতের চেষ্টা করা হবে বলে বিবিসি জানতে পেরেছে। প্রেসিডেন্টের বিরোধী শিবিরের লোকজন এ ষড়যন্ত্র করছে বলে জানা গেলেও পরিকল্পনার বিশদ এখনো জানা সম্ভব হয়নি।<br>তবে প্রেসিডেন্টের একজন মুখপাত্র বলেছেন, তাঁরা ষড়যন্ত্রের কথা জানতে পেরেছেন। এ পরিকল্পনা আন্তর্জাতিক শিষ্টাচারের সুস্পষ্ট লঙ্ঘন।<br>ভারত মহাসাগরে অবস্থিত পর্যটন আকর্ষী এই দ্বীপদেশে বর্তমান প্রেসিডেন্টের সৎভাই মামুন আবদুল গাইয়ুমের তিন দশকের শাসনের অবসান ঘটিয়ে ২০০৮ সালে গণতন্ত্র প্রতিষ্ঠিত হয়। ওই বছরের নির্বাচনে মোহাম্মদ নাশিদ প্রেসিডেন্ট নির্বাচিত হন। এরপর ২০১৩ সালে ক্ষমতায় আসেন আবদুল্লা ইয়ামিন।', 1, '2016-08-26 00:40:31', '2016-08-26 00:40:31', NULL, NULL, 50, 0, 1, NULL, 'বিবিসি', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
