(55, NULL, 50, 'Titas Gas  Limited', NULL, 'orchecd-palaza-titas-gas-limited', 'আমরা অ্যাপ তৈরিতে শীর্ষস্থানে যেতে চাই। একটা ধারণা অনেক দূর নিয়ে যেতে পারে। মোবাইল অ্যাপ নিয়ে আমরা সারা বিশ্বে বিপ্লব করতে চাই।’ ইএটিএল-প্রথম আলো অ্যাপস প্রতিযোগিতা ২০১৬-এর বিশ্ববিদ্যালয় আয়োজনের অংশ হিসেবে মঙ্গলবার রাজধানীর ড্যাফোডিল ইন্টারন্যাশনাল ইউনিভার্সিটি (ডিআইইউ) অনুষ্ঠিত সেমিনারে এ কথা বলেন, বিশ্ববিদ্যালয়টির কম্পিউটার বিজ্ঞান ও প্রকৌশল (সিএসই) বিভাগের প্রধান অধ্যাপক সৈয়দ আক্তার হোসেন। সেমিনারে আরও বক্তৃতা করেন ডিআইইউর সহকারী অধ্যাপক নারায়ণ রঞ্জন চক্রবর্তী ও ইএটিলের ব্যবস্থাপক দীপু রিচার্ড পালমা।\r\nতরুণ প্রোগ্রামার ও অ্যাপস নির্মাতাদের জন্য এথিকস অ্যাডভান্সড টেকনোলজিস লিমিটেড (ইএটিএল) ও প্রথম আলো এ প্রতিযোগিতার আয়োজন করেছে। দিনব্যাপী এ আয়োজনে শিক্ষার্থীদের অ্যাপ তৈরির নানা বিষয়ে জানানো হয়।', 1, '2016-08-26 14:48:55', '2016-08-26 14:48:55', '20160826140848_85082e57d33dd62d5821f9f6ea12c9b8-Gulen.jpg', NULL, 50, 0, 19, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '342342234', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'rtertert', NULL, NULL, 'rtertert', 0),
(56, NULL, 50, 'বাংলাদেশ অ্যাপ তৈরিতে বিপ্লব ঘটাবে', NULL, 'orchecd-palaza-baanlaadesh-ayaap-tairite-biplb-ghttaabe', NULL, 1, '2016-08-26 15:08:40', '2016-08-26 15:08:40', NULL, NULL, 50, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Noor Khan', '45345-345-345', NULL, NULL, '43534534,564564564', '2016-08-26 00:00:00', '2016-08-31 00:00:00', '10:30', '7:30', 'khan@gmail.com', 'Dhaka', NULL, NULL, 0),
(57, NULL, 50, 'আমরা অ্যাপ তৈরিতে শীর্ষস্থানে যেতে চাই।', NULL, 'orchecd-palaza-aamraa-ayaap-tairite-shiirsssthaane-yete-caai', 'আমরা অ্যাপ তৈরিতে শীর্ষস্থানে যেতে চাই। একটা ধারণা অনেক দূর নিয়ে যেতে পারে। মোবাইল অ্যাপ নিয়ে আমরা সারা বিশ্বে বিপ্লব করতে চাই।’ ইএটিএল-প্রথম আলো অ্যাপস প্রতিযোগিতা ২০১৬-এর বিশ্ববিদ্যালয় আয়োজনের অংশ হিসেবে মঙ্গলবার রাজধানীর ড্যাফোডিল ইন্টারন্যাশনাল ইউনিভার্সিটি (ডিআইইউ) অনুষ্ঠিত সেমিনারে এ কথা বলেন, বিশ্ববিদ্যালয়টির কম্পিউটার বিজ্ঞান ও প্রকৌশল (সিএসই) বিভাগের প্রধান অধ্যাপক সৈয়দ আক্তার হোসেন। সেমিনারে আরও বক্তৃতা করেন ডিআইইউর সহকারী অধ্যাপক নারায়ণ রঞ্জন চক্রবর্তী ও ইএটিলের ব্যবস্থাপক দীপু রিচার্ড পালমা।\r\nতরুণ প্রোগ্রামার ও অ্যাপস নির্মাতাদের জন্য এথিকস অ্যাডভান্সড টেকনোলজিস লিমিটেড (ইএটিএল) ও প্রথম আলো এ প্রতিযোগিতার আয়োজন করেছে। দিনব্যাপী এ আয়োজনে শিক্ষার্থীদের অ্যাপ তৈরির নানা বিষয়ে জানানো হয়।\r\nএর আগে সেমিনারে একটি কুইজ প্রতিযোগিতা হয়। প্রতিযোগিতায় নিবন্ধিত হয়ে অংশ নেওয়ার ও ধারণাপত্র জমা দেওয়ার শেষ তারিখ ৩১ আগস্ট। এই প্রতিযোগিতার লিডস স্পনসর ওয়ার্ল্ড ব্যাংক ও কানাডা, স্ট্র্যাটেজিক পার্টনার তথ্য ও যোগাযোগপ্রযুক্তি বিভাগ, মিডিয়া পার্টনার চ্যানেল আই ও টাইটেল পার্টনার হিসেবে আছে প্রথম আলো।', 1, '2016-08-26 15:11:01', '2016-08-26 15:11:01', '20160826150811_3134.full.jpg', NULL, 50, 0, 7, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Noor Khan', '43434-534-534', NULL, NULL, '435345345', '2016-08-30 00:00:00', '2016-08-31 00:00:00', '10:30', '7:30', 'khan@gmail.com', 'Dhaka', NULL, NULL, 0),
(58, NULL, 50, 'প্রযুক্তি আসক্তি কমাতে কর্মশালা', NULL, 'orchecd-palaza-pryukti-aaskti-kmaate-krmshaalaa', 'কম্পিউটার গেম, সামাজিক যোগাযোগমাধ্যমসহ প্রযুক্তির নানা বিষয়ে আসক্তি দেখা যায় এ সময়ের অনেক শিশু-তরুণের মধ্যে। এই আসক্তি কমাতে মা-বাবা এবং পরিবারের সদস্যদের কী করণীয়, তা নিয়ে একটি কর্মশালার আয়োজন করেছে অনলাইনভিত্তিক প্রতিষ্ঠান মনের বন্ধু। ২৬ আগস্ট ঢাকার মোহাম্মদপুরে এই কর্মশালা পরিচালনা করবেন মনোরোগ চিকিৎসক হেলাল উদ্দিন আহমেদ', 1, '2016-08-26 15:15:04', '2016-08-26 15:15:04', NULL, NULL, 50, 0, 11, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(59, NULL, 50, 'কাবা শরিফে জুমার নামাজ আদায় করবেন হাজিরা', NULL, 'orchecd-palaza-kaabaa-shriphe-jumaar-naamaaj-aadaayy-krben-haajiraa', 'বাংলাদেশ থেকে প্রায় ৬০ হাজার হজযাত্রী এরই মধ্যে সৌদি আরবে এসে পৌঁছেছেন। এর মধ্যে কিছু হজযাত্রী মদিনায় অবস্থান করছেন। বাংলাদেশ থেকে আসা বেশির ভাগ হজযাত্রী জীবনে প্রথমবারের মতো আজ মক্কায় কাবা শরিফে জুমার নামাজ আদায় করবেন। অনেকে জুমার নামাজ পড়ার প্রস্তুতি নিচ্ছেন। কেউ কেউ প্রথম কাতারে ইমামের সঙ্গে নামাজ আদায়ের ইচ্ছা প্রকাশ করেছেন।\r\n‘ফজরের নামাজের পর আর বাড়ি ফিরব না। একেবারে জুমার নামাজ পড়ে ফিরব।’ গতকাল বৃহস্পতিবার এমনটাই জানালেন ঢাকার কাঁঠালবাগান থেকে আসা আতাউর রহমান।\r\nজুমার নামাজ শুরুর তিন ঘণ্টা আগেই মসজিদুল হারামের চারপাশের সব সড়কে যানবাহন চলাচল বন্ধ করে দেয় কর্তৃপক্ষ। তাই হাঁটা ছাড়া কোনো উপায় থাকে না। শুক্রবার এখানে ছুটির দিন। গতকাল সন্ধ্যার পরই মক্কা ও এর আশপাশের এলাকা থেকে মসজিদুল হারামের উদ্দেশে রওনা হন মুসল্লিরা। তবে এটা প্রবাসীদের মধ্যেই বেশি। জুমার নামাজ পড়ার পাশাপাশি দেশ থেকে হজ পালন করতে আসা আত্মীয়স্বজনের সঙ্গে দেখা করবেন তাঁরা।\r\nঐতিহাসিক স্থানগুলো ঘুরে দেখছেন হজযাত্রীরা: হজযাত্রীরা মসজিদুল হারামে নামাজ আদায়ের পাশাপাশি ইসলামের ঐতিহাসিক স্থানগুলো পরিদর্শন করছেন।', 1, '2016-08-26 15:17:35', '2016-08-26 15:17:35', NULL, NULL, 50, 0, 11, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(60, NULL, 50, 'এলপি গ্যাস সিলিন্ডারের মান শুধু কাগজেই', NULL, 'orchecd-palaza-elpi-gyaas-silinddaarer-maan-shudhu-kaagjei', 'দেশে তরল পেট্রোলিয়াম (এলপি) গ্যাসের ব্যবহার দ্রুত বাড়ছে। তবে এই গ্যাসের সিলিন্ডারের নিরাপত্তার দিকটি প্রায় উপেক্ষিত। গ্যাসভর্তি সিলিন্ডার বাজারে ছাড়ার আগে এর মান পরীক্ষা করা হয় সংশ্লিষ্ট কোম্পানির দেওয়া কাগজপত্রের ভিত্তিতে। সিলিন্ডারগুলো নিয়মিত পরীক্ষাও করা হয় না।<br>বাংলাদেশ পেট্রোলিয়াম করপোরেশন (বিপিসি), বিস্ফোরক অধিদপ্তর এবং বেসরকারি এলপি গ্যাস কোম্পানিগুলোর সূত্রের সম্মিলিত হিসাব অনুযায়ী দেশে বর্তমানে এলপি গ্যাসের সিলিন্ডার আছে প্রায় ২০ লাখ। এর মধ্যে অন্তত দুই লাখ মেয়াদোত্তীর্ণ। প্রায় তিন লাখ অতি পুরোনো। গ্যাস ভরে বাজারে ছাড়ার আগে সিলিন্ডারের মান পরীক্ষা করে সনদ দেয় বিস্ফোরক অধিদপ্তর। কী ধরনের পরীক্ষা করেন জানতে চাইলে অধিদপ্তরের প্রধান পরিদর্শক মো. শামসুল আলম প্রথম আলোকে বলেন, তাঁরা মূলত এ-সংক্রান্ত কাগজপত্র পরীক্ষা&nbsp;করে সনদ দেন।', 1, '2016-08-26 15:24:14', '2016-08-26 15:24:14', '20160826150824_Smoothproducts-master.zip', NULL, 50, 0, 8, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-08-30 00:00:00', '2016-09-08 00:00:00', NULL, NULL, NULL, NULL, NULL, NULL, 0),
(61, NULL, 50, 'উৎখাত চক্রান্তের মুখে মালদ্বীপের প্রেসিডেন্ট', NULL, 'orchecd-palaza-u-khaat-ckraanter-mukhe-maaldbiiper-presiddentt', 'তাদের দলের প্রতিষ্ঠাতা জিয়াউর রহমানের মরণোত্তর স্বাধীনতা পদক প্রত্যাহার করতে চাইছে সরকার। দলটি বলেছে, সরকারের মন্ত্রিসভা কমিটির এ সিদ্ধান্ত আত্মঘাতী .', 1, '2016-08-26 18:57:04', '2016-08-26 18:57:04', '20160826180857_85082e57d33dd62d5821f9f6ea12c9b8-Gulen.jpg', NULL, 50, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
