(338, NULL, 'Luxy Shop', 100, '5000', '6000', '6000', NULL, NULL, NULL, 1, NULL, 19, 13, NULL, NULL, 'goods', 'Refresh your home desktop without breaking the bank by investing in this slim and sleek all-in-one PC from Lenovo. Elegant and efficient, the C20 has a space-saving design with 19.5-inch display.\r\nPlay, watch, listen and store\r\nIntegrated DVD/CD reader and writer, 2 built-in stereo speakers and integrated graphics card to meet all your entertainment needs. Play music and watch films when your offline and make a hard copy of all your media to keep it safe and your PC uncluttered.\r\nIntel Processor\r\nThe quad-core Intel Pentium processor and 4GB RAM keeps everything ticking along, allowing you to get through your everyday tasks, from browsing, writing documents and emailing friends and family.\r\nAmple hard drive\r\nStore all your photos, video, music and more on the 500GB hard drive. There is plenty of room for multiple users to store data for convenient access.\r\nWebcam\r\nThe built in webcam with HD 720p resolution let you enjoy video calls in greater clarity.\r\nExcellent connections\r\nUse the HDMI output for connecting other HD devices while a variety of USB 2.0 and USB 3.0 ports will help you connect a multitude of devices.', NULL, 'luxy-shop', '2016-08-27 23:12:53', '2016-09-10 11:56:01', '20160829050836_12002753_1636888016580765_5846522745413655277_n.jpg', 19, 12, 7, 1, 43, 68),
