INSERT INTO `SiteContent` (`id`, `parent`, `name`, `content`, `slug`, `isPage`, `status`, `created`, `path`) VALUES
(1, NULL, 'About us', 'Fifteen years ago, we launched salesforce.com \r\nwith a vision to reinvent CRM in the cloud. \r\n\r\nAnd a new technology model was born.\r\nWe also put aside 1% of our equity, 1% of our employees’ time, and 1% of our product, and formed Salesforce.org. These two key decisions have fueled our incredible growth, made us the global leader in CRM, defined the era of cloud computing, and inspired a new philanthropic model for all to follow.\r\n\r\nToday, thanks to our dedicated employees, partners, and the customers we serve, our industry-leading CRM platform has become the world''s leading enterprise cloud ecosystem. Industries and companies of all sizes can connect to their customers in a whole new way using the latest innovations in mobile, social, and cloud technology to sell, service, market, and succeed like never before.', 'about-us', 0, 1, '0000-00-00 00:00:00', NULL),
(2, NULL, 'Terms of Service', 'এ মাসের আবহাওয়ার পূর্বাভাসে বলা হয়েছিল, এপ্রিলে স্বাভাবিকের চেয়ে বেশি বৃষ্টি হবে। বঙ্গোপসাগরে সৃষ্টি হতে পারে দু-একটি নিম্নচাপ, হতে পারে তিন-চারটি কালবৈশাখী। আর দাবদাহ হতে পারে দু-একটি। মাস শেষ হতে বাকি আর এক দিন। এই এক দিনের মধ্যে আবহাওয়া অধিদপ্তরের এই পূর্বাভাস সত্যি হতে হলে অনেকটা ক্রিকেট খেলায় শেষ বলে ১০০ রান নেওয়ার মতো ঘটনা ঘটতে হবে।<br>আবহাওয়ার পূর্বাভাস তো এবার মিললই না, বরং খরতাপের রুদ্ররূপ আর বৃষ্টির গোস্সা দেখেই পার হয়ে গেল এপ্রিলের প্রায় পুরোটা। গত ৩০ বছরের তাপমাত্রা আর বৃষ্টিপাতের হিসাব করলে এপ্রিলকে রেকর্ড সৃষ্টিকারী মাস বলা যায়। হিসাব অনুযায়ী চলতি মাসে বাংলাদেশের ইতিহাসে সবচেয়ে দীর্ঘ তাপপ্রবাহটি বয়ে যাচ্ছে। ৬ এপ্রিল থেকে শুরু হয়ে টানা ২৩ দিন ধরে দাবদাহটি দেশের বিভিন্ন এলাকার ওপর দিয়ে বয়ে যাচ্ছে। এর ফলে এপ্রিলে সাধারণত যে গড় তাপমাত্রা থাকে, এখন তাপমাত্রা তার চেয়ে সারা দেশে ৫ থেকে ৬ ডিগ্রি সেলসিয়াস বেশি।&nbsp;<br>এই দাবদাহের দাপটে মানুষ তো বটেই, সড়কপথে যানবাহনও যেন ভয়ে নিরাপদ আশ্রয়ে চলে গেছে। ঠা ঠা রোদ আর হাঁসফাঁস গরমের কারণে দুপুরের দিকে রাজধানীর বেশির ভাগ সড়ক বেশ ফাঁকা হয়ে যায়।<br>আবহাওয়া অধিদপ্তরের হিসাব অনুযায়ী, এপ্রিলে সাধারণত এক থেকে দুটি তাপপ্রবাহ বয়ে যায়, যা সর্বসাকল্যে ছয় থেকে সাত দিন স্থায়ী হয়। এর আগে ১৯৯৫ সালে দেশের ১২টি জেলায় ঘুরেফিরে আট দিন দাবদাহ ছিল। এরপর ২০০৭ সালে সাতটি জেলায়, ১৯৯৯ ও ২০০৯ সালে ছয়টি জেলায় পাঁচ থেকে ছয় দিন দাবদাহ বয়ে গেছে। কিন্তু টানা ২৩ দিন দাবদাহ চলতে দেখা যায়নি।&nbsp;<br>আর বৃষ্টিপাতের হিসাব নিতে গেলে এই বঙ্গীয় ব-দ্বীপের বেশির ভাগ মানুষের কপালে বঞ্চনার তথ্যই মিলবে। আবহাওয়া অধিদপ্তরের হিসাবে, এপ্রিলে সারা দেশ মিলিয়ে ১৬৬ দশমিক ৩ মিলিমিটার ও ঢাকায় ১৩০ মিলিমিটার বৃষ্টিপাত হয়ে থাকে। এ বছরের এপ্রিলে ঢাকায় বৃষ্টির পরিমাণ হিসাব করলে ৩ থেকে ৫ মিলিমিটারের বেশি হবে না। তাও রাজধানীর উত্তর ও পূর্বাঞ্চলের দু-একটি এলাকায় ঝরেছে।&nbsp;<br>এবারের এপ্রিলের হাওয়ার গতি-প্রকৃতির হিসাব নিলে অবশ্য হতাশা আরও বাড়বে। কালবৈশাখীর এই মাসে এখনো ঝোড়ো হাওয়ার দেখাই পায়নি রাজধানী বা দেশবাসী কেউই। মাঝে মাঝে যে দমকা হাওয়া এসেছে, তার সঙ্গে ভেসে এসেছে জলীয় বাষ্প। এতে বাতাসের তাপ পরিবহনক্ষমতা গেছে বেড়ে। ফলে কালবৈশাখীর কারণে গ্রীষ্মের খরতাপে যে কিছুটা বিরতি পড়ে, তাও এবার হয়নি। ফলে সব মিলিয়ে এবারের বৈশাখকে গত ৩০ বছরের মধ্যে বিশেষ ব্যতিক্রম হিসেবেই বলছেন আবহাওয়াবিদেরা।<br>এই মাসের আবহাওয়ার পূর্বাভাস কেন পাওয়া যায়নি—জানতে চাইলে আবহাওয়া অধিদপ্তরের আবহাওয়াবিদ তাসলিমা ইমাম প্রথম আলোকে বলেন, এল নিনো নামে আবহাওয়ার এক বিশেষ অবস্থার কারণে প্রশান্ত মহাসাগরের মাঝ বরাবর তাপমাত্রা বেড়ে গেছে। এর প্রভাবে আফ্রিকা থেকে শুরু হয়ে পূর্ব এশিয়া হয়ে দক্ষিণ এশিয়া পর্যন্ত আবহাওয়াগত খরা পরিস্থিতি তৈরি হয়েছে, যার প্রভাব বাংলাদেশের ওপরেও পড়েছে। যে কারণে এবারের এপ্রিলে আবহাওয়ার পূর্বাভাস মিলছে না।&nbsp;<br>তবে আবহাওয়া অধিদপ্তরের পর্যবেক্ষণ অনুযায়ী, ইতিমধ্যে ভারতের পশ্চিমবঙ্গ হয়ে এক খণ্ড মেঘ বাংলাদেশের ওপরে ভেসে এসেছে। এর প্রভাবে গতকাল বৃহস্পতিবার ময়মনসিংহে ২৮ মিলিমিটার, রংপুরে ৫, সিলেটে ৪, শ্রীমঙ্গলে ১ মিলিমিটার এবং মাদারীপুরে সামান্য বৃষ্টিপাত হয়েছে। আজও রংপুর ও কুমিল্লা অঞ্চল, ঢাকা, রাজশাহী ও সিলেট বিভাগের দু-এক জায়গায় ঝোড়ো হাওয়াসহ বৃষ্টি হতে পারে।&nbsp;<br>তবে ঢাকা, টাঙ্গাইল, ফরিদপুর, মাদারীপুর, শরীয়তপুর, গোপালগঞ্জ, চাঁদপুর জেলা এবং খুলনা ও রাজশাহী বিভাগের ওপর দিয়ে বয়ে যাওয়া মৃদু থেকে মাঝারি শৈত্যপ্রবাহটি আজও বয়ে যাবে। দিন ও রাতের তাপমাত্রা গতকালের মতো অর্থাৎ অপরিবর্তিত থাকতে পারে। তবে দুদিন ধরে দেশের বেশির ভাগ এলাকায় বাতাসের আপেক্ষিক আর্দ্রতা বাড়ছে, যা আজও অব্যাহত থাকতে পারে। ফলে আকাশে কালো মেঘ বা দু-এক পশলা বৃষ্টির সম্ভাবনা থাকলেও গরমের দাপট থেকে আপাতত নিস্তার মিলছে না।&nbsp;<br>এ ব্যাপারে আবহাওয়া অধিদপ্তরের আবহাওয়াবিদ আবদুর রহমান প্রথম আলোকে বলেন, দেশের দু-একটি এলাকায় বৃষ্টি হলেও তাপমাত্রা এখনই কমছে না। কেননা, তাপমাত্রা কমতে হলে টানা এক থেকে দেড় ঘণ্টা বৃষ্টি হতে হবে, যা হওয়ার আপাতত কোনো সম্ভাবনা দেখা যাচ্ছে না।', 'terms-of-service', 1, 1, '0000-00-00 00:00:00', NULL),
(3, NULL, 'Privacy & Policy', 'privacy-policy', 'privacy-policy', 0, 0, '0000-00-00 00:00:00', NULL);
