INSERT INTO `Testimonial` (`id`, `user_id`, `name`, `designation`, `title`, `slug`, `content`, `created`, `status`, `isFeature`, `path`, `globalOption_id`, `updated_at`) VALUES
(1, 34, 'Tanni', 'Junior Teacher', 'Xebec International School', 'xebec-international-school', 'আবুল কাসেম ফজলুল হক: আফগানিস্তান, ইরাক, সিরিয়া, লিবিয়ায় কী হয়েছে? কী হচ্ছে? আফগানিস্তানে রুশদের বিরুদ্ধে তালেবানদের উত্থানে মার্কিন যুক্তরাষ্ট্র সহায়তা দিয়েছে। মধ্যপ্রাচ্যের দেশগুলোয় আল-কায়েদা, আইএস ইত্যাদি জঙ্গি সংগঠন তৈরি হয়েছে। জঙ্গিগোষ্ঠীগুলো এখন এশিয়া, ইউরোপ ও আমেরিকার বেশ কিছু দেশে ইসলামের নামে গুপ্তহত্যা চালাচ্ছে। ভারত ও বাংলাদেশ সরকার মার্কিন যুক্তরাষ্ট্রের জঙ্গিবাদবিরোধী যুদ্ধে শামিল থাকার চুক্তিতে আবদ্ধ। এর ফলে তালেবান, আল-কায়েদা, আইএস বাংলাদেশ ও ভারতকে তাদের কর্মক্ষেত্র হিসেবে গ্রহণ করেছে। এই বাস্তবতার মধ্যে পরিপূর্ণ সততার সঙ্গে আমাদের সমাধানের পথ ভাবতে হবে।', '2016-04-29 16:57:44', 1, 1, 'Screenshot from 2015-11-05 08:53:07.png', 38, '0000-00-00 00:00:00'),
(2, 34, 'Welcome to Xebec International School and the colorful, c', 'Junior Teacher', 'Xebec International School', 'xebec-international-school', 'Welcome to Xebec International School and the colorful, creative, caring, confronting and sometimes chaotic life! Upon arrival at our school it becomes immediately apparent that you have entered a welcoming community school. From the first smile of our reception staff through to the buzzing throng of parents and students who gathers within the school yard eager to commence the school day. \r\n\r\nOur Primary school is housed within two purpose built facilities and upon entering the school you are greeted by the laughter of our youngest students who inquire and learn through play. The school welcomes Playgroup students, who at three years of age enjoy the opportunity to explore and play alongside other young children. Our Nursery classrooms support the learning of four year old students. Their classrooms are filled with activities and learning tasks that promote creativity, inquiry and the development of independence. Both of these groups are offered a half day program five days per week in either am or pm sessions.\r\n\r\nParents are seen as an integral part of our school community and they are welcomed into the learning partnership that is essential for students to experience success. Xebec International School is an inclusive school community that is committed to developing confident, skilled and successful global citizens.', '2016-04-30 15:29:23', 1, 0, '12167118_1178667888827128_196361870_n.jpg', 38, '0000-00-00 00:00:00'),
(3, 38, 'M Shafiq Islam', 'Manager', 'RBS', 'rbs', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form injected humour, or randomised words which don''t look even slightly believable. If you are going to use a passage available, but the majority have suffered to use a passage.There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form injected humour, or randomised words which don''t look even slightly believable. If you are going to use a passage available, but the majority have suffered to use a passage.', '2016-07-14 08:04:24', 1, 0, '1.jpg', 44, '2016-07-14 08:07:48'),
(4, 38, 'Zunayrah Islam', 'CEO', 'Business Booster Ltd.', 'business-booster-ltd', 'There are many variations but the majority have suffered alteration in some form randomised words which don''t look even are many variations of passages of Lorem Ipsum avaieare many variations of passages avai.', '2016-07-14 08:09:05', 1, 0, NULL, 44, '2016-07-14 08:09:05'),
(5, 16, 'Arifur Rahman', 'Manger', 'Titas Gas & Distribution System Ltd', 'titas-gas-distribution-system-ltd', 'ভুয়া সুইফট মেসেজ ব্যবহার করে অগ্রণী ব্যাংক থেকে ৩ কোটি ৩০ লাখ ইউরো অর্থাৎ ২৮০ কোটি টাকা হাতিয়ে নেওয়ার চেষ্টার অভিযোগে দুই প্রতারকের বিরুদ্ধে মামলা করেছে দুর্নীতি দমন কমিশন (দুদক)।\r\n\r\nআজ শনিবার সন্ধ্যায় রাজধানীর মতিঝিল থানায় মামলাটি (মামলা নম্বর ১২) করেন সংস্থার উপসহকারী পরিচালক মো. সাইদুজ্জামান। তিনি প্রথম আলোকে বলেন, মামলায় আসামি করা হয়েছে জনৈক লুৎফর রহমান ও আবুল কালাম আজাদ নামের দুই ব্যক্তিকে।\r\n\r\nমামলার এজাহারে বলা হয়েছে, সুইস ব্যাংকের ব্যবস্থাপকের জাল চিঠি ও দ্রুত বার্তার (সুইফট মেসেজ) জাল কপি দেখিয়ে রাজধানীর অগ্রণী ব্যাংকের আমিন কোর্ট শাখা থেকে অর্থ হাতিয়ে নেওয়ার চেষ্টা করে প্রতারক চক্র। বাংলাদেশ ব্যাংকের একটি পরিদর্শন প্রতিবেদন এ তথ্য তুলে ধরে ঘটনাটি অনুসন্ধানের জন্য ২০১৪ সালের আগস্ট মাসে দুদকে আসে। দুদক বিষয়টি যাচাই–বাছাইয়ের পর অনুসন্ধানের সিদ্ধান্ত নেয়।\r\n\r\nঅনুসন্ধান সূত্রে জানা গেছে, রাজধানীর মিরপুরের একটি হোমিও ক্লিনিকের ঠিকানা ব্যবহার করে জনৈক লুৎফর রহমান অগ্রণী ব্যাংকে একটি হিসাব খোলেন। হিসাব খোলার সময় তাঁর শনাক্তকারী ছিলেন মুন্সীগঞ্জের লৌহজং এলাকার বাসিন্দা আবুল কালাম আজাদ।\r\n\r\nসূত্র জানায়, লুৎফর রহমান তাঁর ওই হিসাবে সন্দেহজনক লেনদেনের চেষ্টা করেছেন। ২০১৪ সালের ২৭ আগস্ট তিনি অগ্রণী ব্যাংকের ব্যবস্থাপনা পরিচালক বরাবর ডাকযোগে চিঠি পাঠিয়ে রেমিট্যান্সের টাকা উত্তোলনের বিষয়ে জানান। ওই চিঠির সঙ্গে লুৎফর রহমান সুইস ব্যাংকের ব্যবস্থাপক ‘মার্টিন ডি স্যা পিন্টোর’ সইসংবলিত একটি চিঠির কপি ও সুইফট মেসেজের কপি সংযুক্ত করেন।', '2016-07-16 23:36:23', 1, 0, '1.jpg', 10, '2016-07-16 23:36:23'),
(6, 16, 'আসাদুজ্জামান খান কামাল', 'স্বরাষ্ট্রমন্ত্রী', 'Bangladesh Government', 'bangladesh-government', 'লশানের হলি আর্টিজান বেকারি রেস্তোরাঁয় হামলার মদদদাতাদের চিহ্নিত করা হয়েছে বলে জানিয়েছেন স্বরাষ্ট্রমন্ত্রী আসাদুজ্জামান খান কামাল। আজ শনিবার দুপুরে সচিবালয়ে নিজের কার্যালয়ে সাংবাদিকদের প্রশ্নের জবাবে স্বরাষ্ট্রমন্ত্রী এ কথা বলেন।\r\nস্বরাষ্ট্রমন্ত্রী বলেন, ১ জুলাইয়ের হামলায় (গুলশান হামলা) যাঁরা যাঁরা জড়িত যাঁরা যাঁরা মদদ দিয়েছেন, তাঁদের পুলিশ চিহ্নিত করতে পেরেছে। তিনি বলেন, ‘যাঁরা যাঁরা এ​র মদদ দিচ্ছেন, তাঁদের আমরা চিহ্নিত করেছি। আমাদের নিরাপত্তা বাহিনী, আমাদের গোয়েন্দা বাহিনী অত্যন্ত তৎ​পর। আমরা মনে ক​রছি আমরা সঠিক পথে চলছি। আমরা যারা জড়িত, তাদের ঠিকমতো চিহ্নিত করেছি।’', '2016-07-16 23:45:39', 1, 0, 'b3fcdd196f5895ca2f4b033ae3f26a10-p.jpg', 10, '2016-07-16 23:45:39'),
(7, 50, 'আসাদুজ্জামান খান কামাল', 'স্বরাষ্ট্রমন্ত্রী', 'Bangladesh Government', 'bangladesh-government', 'Objectively innovate empowered manufactured products whereas parallel platforms. Holisticly predominate extensible testing procedures for reliable supply chains. Dramatically engage top-line web services vis-a-vis cutting-edge deliverables. Proactively envisioned multimedia based expertise and cross-media growth strategies. Seamlessly visualize quality intellectual capital without superior collaboration.', '2016-08-13 15:23:37', 1, 0, '20160813150823_port6.jpg', 50, '2016-08-13 15:23:37'),
(8, 50, 'Arifur Rahman', 'Manger', 'Titas Gas & Distribution System Ltd', 'titas-gas-distribution-system-ltd', 'সত প্রকাশ বলেন, ‘...ছয় থেকে সাতজন লোক রেস্তোরাঁর দিকে ছুটে আসছিল। আমি চেয়ার থেকে উঠে দাঁড়ালাম। কিন্তু কী করব বুঝে উঠতে পারছিলাম না। এরপরই আমি গুলির আওয়াজ শুনলাম এবং একজনকে পড়ে যেতে দেখলাম। একই সময়ে আমি “আল্লাহু আকবার” স্লোগান শুনলাম। একটা থামের পেছনে লুকানোর চেষ্টা করছিলাম। কয়েক সেকেন্ডের মধ্যে দেখলাম একজন মুখে হাত চাপা দিয়ে ছুটছেন। তাঁর মুখে রক্ত ছিল। জাপান, চীন ও কোরিয়ার মতো দূরপ্রাচ্যের কোনো দেশের লোকের মতো চেহারা তাঁর। চিন্তা করলাম, যেকোনো উপায়ে এখান থেকে বেরিয়ে যেতে হবে। এক শ্রীলঙ্কান দম্পতি—যাঁদের আমি আগে থেকেই চিনতাম, তাঁরাও লুকানোর জন্য থামের পেছনে এসেছেন। জানালা দিয়ে দেখতে পেলাম, একজন হামলাকারী মাটিতে পড়ে থাকা এক ব্যক্তিকে ধারালো অস্ত্র দিয়ে আঘাত করছে। আমি সঙ্গে সঙ্গে চোখ ফিরিয়ে নিলাম। দম্পতি আসার পরপরই হামলাকারীদের একজন সেখানে এসে বলল, লুকিয়ে থাকবেন না। আমরা আপনাদের ক্ষতি করব না। আপনারা এখানে নিরাপদ নন। এক্ষুনি বেরিয়ে আসুন। আমরা তাদের কথামতো বেরিয়ে এলাম। ওই একই হামলাকারী আমাদের মোবাইল ফোন ব্যবহার করতে নিষেধ করল।', '2016-08-13 15:24:55', 1, 0, '20160813150824_blog2.jpg', 50, '2016-08-13 15:24:55'),
